import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import './App.css';
import DoctorsCategories from './components/DoctorsCategories';
import DoctorDetails from './components/DoctorDetials';

const App = () => (
    <Router>
      <Switch>
        <Route path='/' exact component={DoctorsCategories} />
        <Route path='/doctors' exact component={DoctorDetails} />
      </Switch>
    </Router>
);


export default App;
